var MopidyMock = function () {
    return {
        on: function (eventName, func) {
            func()
        },
        playlists: {
            asList: function () {
                return Promise.resolve(asListData)
            },
            lookup: function (args) {
                const uri = args['uri']
                console.log(`Lookup Playlist ${uri}`)
                return Promise.resolve(lookupData[uri])
            },
            delete: function (args) {
                const uri = args['uri']
                console.log(`Deleting Playlist ${uri}`)
                delete lookupData[uri]
                return Promise.resolve(true)
            },
            save: function (args) {
                const playlist = args['playlist']
                console.log(`Saving playlist ${playlist.uri}: ${playlist.name}`)
                lookupData[playlist.uri] = playlist
                return Promise.resolve(playlist)
            },
        },
    }
}
